import React from 'react';
import { Container, Typography, Paper, Box, Grid, Card, CardContent } from '@mui/material';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import DatasetIcon from '@mui/icons-material/Dataset';
import BalanceIcon from '@mui/icons-material/Balance';
import VerifiedIcon from '@mui/icons-material/Verified';
import UpdateIcon from '@mui/icons-material/Update';

const MotionCard = ({ icon, title, children, delay }) => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  return (
    <motion.div
      ref={ref}
      initial={{ opacity: 0, y: 50 }}
      animate={inView ? { opacity: 1, y: 0 } : { opacity: 0, y: 50 }}
      transition={{ duration: 0.5, delay }}
    >
      <Card elevation={3} sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
        <CardContent>
          <Box display="flex" alignItems="center" mb={2}>
            {icon}
            <Typography variant="h6" ml={1}>
              {title}
            </Typography>
          </Box>
          {children}
        </CardContent>
      </Card>
    </motion.div>
  );
};

const Methodology = () => {
  return (
    <Container maxWidth="lg" sx={{ mt: 8, mb: 8 }}>
      <motion.div
        initial={{ opacity: 0, y: -50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
      >
        <Typography 
          variant="h3" 
          gutterBottom 
          align="center"
          sx={{ 
            mb: 6,
            fontWeight: 'bold',
            background: 'linear-gradient(45deg, #1976d2 30%, #21CBF3 90%)',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent'
          }}
        >
          Metode og dataindsamling
        </Typography>
      </motion.div>

      <Grid container spacing={4}>
        <Grid item xs={12} md={6}>
          <MotionCard 
            icon={<DatasetIcon sx={{ fontSize: 40, color: '#1976d2' }} />}
            title="Dataindsamling og kilder"
            delay={0.2}
          >
            <Typography variant="body1">
              Vi indsamler data fra en bred vifte af danske nyhedsmedier. Vores system scanner
              løbende mediernes websider og analyserer artikler, overskrifter og metadata.
              Dette giver os et omfattende datasæt, der danner grundlag for vores analyser.
            </Typography>
          </MotionCard>
        </Grid>

        <Grid item xs={12} md={6}>
          <MotionCard 
            icon={<BalanceIcon sx={{ fontSize: 40, color: '#1976d2' }} />}
            title="Analyse af politisk orientering"
            delay={0.4}
          >
            <Typography variant="body1" paragraph>
              Den politiske orientering vurderes gennem en kombination af:
            </Typography>
            <Typography component="ul">
              <li>Sprogbrug og ordvalg i artikler</li>
              <li>Valg af emner og vinkling</li>
              <li>Historisk dækning af politiske sager</li>
              <li>Eksterne ekspertvurderinger</li>
            </Typography>
          </MotionCard>
        </Grid>

        <Grid item xs={12} md={6}>
          <MotionCard 
            icon={<VerifiedIcon sx={{ fontSize: 40, color: '#1976d2' }} />}
            title="Vurdering af pålidelighed"
            delay={0.6}
          >
            <Typography variant="body1" paragraph>
              Pålideligheden vurderes ud fra flere faktorer:
            </Typography>
            <Typography component="ul">
              <li>Faktuel nøjagtighed</li>
              <li>Kildebrug og transparens</li>
              <li>Rettelser og opdateringer</li>
              <li>Adskillelse af nyheder og opinion</li>
            </Typography>
          </MotionCard>
        </Grid>

        <Grid item xs={12} md={6}>
          <MotionCard 
            icon={<UpdateIcon sx={{ fontSize: 40, color: '#1976d2' }} />}
            title="Opdatering af data"
            delay={0.8}
          >
            <Typography variant="body1">
              Vores database opdateres dagligt med nye artikler og analyser. Dette sikrer,
              at vores vurderinger altid afspejler mediernes aktuelle dækning og tendenser.
              Vi bruger avancerede algoritmer til at sikre præcise og opdaterede resultater.
            </Typography>
          </MotionCard>
        </Grid>
      </Grid>
    </Container>
  );
};

export default Methodology;
